import MyPosts from "./MyPosts/MyPosts"
import MyPostsContainer from "./MyPosts/MyPostsContainer"
import ProfileInfo from "./ProfileInfo"

const Profile = (props) => {
  return (
    <>
      <ProfileInfo profile={props} />
      <MyPostsContainer />
    </>
  )
}

export default Profile
